import React from 'react';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>Roadmap of Skills</li>
        <li>Character Stats</li>
        <li>Todo List</li>
      </ul>
    </nav>
  );
};

export default Navbar;
